  // Catch Rating value
  const handleRating = (rate) => {
    setRating(rate)
    // Some logic
  }
  return (
    <div>
      <Rating
        onClick={handleRating}
        ratingValue={rating}
        size={20}
        label
        transition
        fillColor='orange'
        emptyColor='gray'
        className='foo' // Will remove the inline style if applied
      />
      {/* Use rating value */}
      {}
    </div>
  )
}

